import s from "./../Nav.module.css";

const  Friends = (props) =>{
    return(
        <div>
            <a className={s.link} to="">
              <img
                className={s.img_planet_item}
                src={props.name}
                alt=""
              />
                {props.name}
            </a>
            
          </div>
    )
}

export default Friends;
